@Zhangshunyu 
It may be devloper to estimate but we should have mechanism either to throw exception or handle concurrent scenario.
And also the API's are not abstract enough, all the handling code should inside the APIs and also the stages are not understandable. Please have a look at PR https://github.com/HuaweiBigData/carbondata/pull/356  , Please check how the stages and calculation is handled.

@ravipesala pls review.
For stages, I think load is streaming like process, and it's hard to divide the stages into independent stage1 stage2, stage n, so I hanlded the statistics like the log info shows.
For exception hanle, I added exception handle in print, it will not has bad effect on load process.

@Zhangshunyu  
Firstly, you can split dataloading flow to some stages by reference to PR HuaweiBigData/carbondata#356. I think these stages also should contain e2e, driver, executor and so on.

Secondly, you can simplify the API in CarbonLoadStatisticsImpl, CarbonLoadStatisticsDummy and LoadStatistics. Now you defined  methods for each stage, but I think you can use one method with a stage parameter to abstract the API.
